import React from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import firstFoto from '../../images/carousel/car_first.jpg';
import secondFoto from '../../images/carousel/car_second.jpg';
import thirdFoto from '../../images/carousel/car_third.jpg';
import fourthFoto from '../../images/carousel/car_fourth.jpg';
import fifthFoto from  '../../images/carousel/car_fifth.jpg';
import sixthFoto from '../../images/carousel/car_sixth.jpg';
import './KnowUs.css'; // Import your CSS file

const KnowUs = () => {
  var settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 3,
    slidesToScroll: 2
  };

  return (
    <div className="slider-container">
      <h2>Con√≥cenos</h2>
      <Slider {...settings}>
        <div>
          <img src={firstFoto} alt="Slide 1" className="brand-logo"/> 
        </div>
        <div>
          <img src={secondFoto} alt="Slide 2" className="brand-logo"/> 
        </div>
        <div>
          <img src={thirdFoto} alt="Slide 3" className="brand-logo"/> 
        </div>
        <div>
          <img src={fourthFoto} alt="Slide 4" className="brand-logo"/> 
        </div>
        <div>
          <img src={fifthFoto} alt="Slide 5" className="brand-logo"/> 
        </div>
        <div>
          <img src={sixthFoto} alt="Slide 6" className="brand-logo"/> 
        </div>
      </Slider>
    </div>
  );
}

export default KnowUs;
